import{_ as a,c as t,o as e,V as o}from"./chunks/framework.1tKwlg2J.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"稀土开发者大会2022/intro.md","filePath":"稀土开发者大会2022/intro.md","lastUpdated":1705759568000}'),r={name:"稀土开发者大会2022/intro.md"},i=o('<h2 id="出品方介绍" tabindex="-1">出品方介绍 <a class="header-anchor" href="#出品方介绍" aria-label="Permalink to &quot;出品方介绍&quot;">​</a></h2><p>稀土开发者大会是由稀土掘金技术社区主办，集国际化前瞻性及实践性为一体的综合性技术大会。本届大会的主题为「激发万有引力，掘金技术未来」，将面向开发者社区的中坚力量，集结近百位国内外技术大咖，开设超 18 场专业主题论坛，内容涵盖大前端、云原生、AI、开源以及技术管理等多个方向，旨在帮助开发者拓宽技术视野，传播前沿的技术理念，共创开发者的技术盛会。</p><h2 id="小册介绍" tabindex="-1">小册介绍 <a class="header-anchor" href="#小册介绍" aria-label="Permalink to &quot;小册介绍&quot;">​</a></h2><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/a24a39f35a2747d398885135de891ab8~tplv-k3u1fbpfcp-jj-mark:1512:0:0:0:q75.avis" alt="小册-课程介绍.jpg"></p><p>为期 2 天的技术之旅XDC 2022 圆满收官！18+ 技术专题，从前端到全栈，从云原生到低代码，尤雨溪、月影、玉伯技术大咖携手80 余位讲师齐聚一堂，干货满满！</p><p>大家期待已久的XDC 2022 讲师PPT以「掘金小册」的形式和大家见面了！ 即刻登陆稀土掘金技术社区，点击主站导航栏“课程”栏目即可立即加入学习，随时查阅。</p><p>相信技术，传递价值，稀土掘金与万千开发者一起，持续学习，共同成长。</p><h2 id="注意事项" tabindex="-1">注意事项 <a class="header-anchor" href="#注意事项" aria-label="Permalink to &quot;注意事项&quot;">​</a></h2><p>1、掘金小册版权归作者所有，任何机构、媒体、网站或个人未经本网协议授权不得转载、链接、转贴或以其他方式复制发布/发表，违者将依法追究责任；</p><p>2、在掘金小册阅读过程中，如有任何问题，请邮件联系 <a href="mailto:xiaoce@xitu.io" title="mailto:xiaoce@xitu.io" target="_blank" rel="noreferrer">xiaoce@xitu.io</a></p>',10),n=[i];function p(c,s,l,_,d,h){return e(),t("div",null,n)}const u=a(r,[["render",p]]);export{m as __pageData,u as default};
